import React from 'react';
import Popup from 'reactjs-popup';
import 'reactjs-popup/dist/index.css';

const divStyle = {
  color: '#082459',
  fontSize: '24px',
  fontFamily: 'Roboto',
  fontWeight: 700,
  wordWrap: 'break-word',
  display: 'flex',
  justifyContent: 'center'
};

const boxget = {
  borderRadius: '10px',
};

export default function Inputfood() {
  return (
    <div style={boxget}>
      <Popup trigger={<button> กรอก </button>} modal nested>
        {(close) => (
          <div>
            <div style={divStyle}>
              กรอกอาหาร
            </div>
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>
              <button onClick={() => close()}>
                บันทึก
              </button>
            </div>
          </div>
        )}
      </Popup>
    </div>
  );
}
